import React from "react";
import Counter from "./components/Counter";
import UserDataForm from "./components/UserDataForm";
import RichTextEditor from "./components/RichTextEditor";

function App() {
  return (
    <div>
      <Counter />
      <div style={{ marginTop: "30px" }}>
        <UserDataForm />
      </div>
      <div style={{ marginTop: "30px" }}>
        <RichTextEditor />
      </div>
    </div>
  );
}


export default App;
